Ext.data.JsonP['Titanium_SDK_5.5.1.GA_Release_Note']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>Titanium SDK 5.5.1.GA - 28 September 2016</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n\t\t<div id=\"banner\" class=\"confbox admonition admonition-note aui-message warning shadowed information-macro\">\n\t\t\t<p>You can now find Appcelerator documentation at <a href=\"https://docs.axway.com/\" target=\"_blank\">https://docs.axway.com/</a>. This site will be taken down in the near future.</p></div>\n        <div class=\"header\"/>\n\n        <div id=\"src-46257788\" class=\"content\">\n                        <h1>Titanium SDK 5.5.1.GA - 28 September 2016</h1>\n    <div class=\"section section-2 \" id=\"src-46257788_TitaniumSDK5.5.1.GAReleaseNote-Contents\">\n        <h2 class=\"heading \"><span>Contents</span></h2>\n<ul class=\"toc-indentation \"><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Titanium_SDK_5.5.1.GA_Release_Note-section-src-46257788_TitaniumSDK5.5.1.GAReleaseNote-AboutThisRelease\">About This Release</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Titanium_SDK_5.5.1.GA_Release_Note-section-src-46257788_TitaniumSDK5.5.1.GAReleaseNote-CommunityCredits\">Community Credits</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Titanium_SDK_5.5.1.GA_Release_Note-section-src-46257788_TitaniumSDK5.5.1.GAReleaseNote-FixedIssuespatchreleases\">Fixed Issues patch releases</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Titanium_SDK_5.5.1.GA_Release_Note-section-src-46257788_TitaniumSDK5.5.1.GAReleaseNote-APIChanges\">API Changes</a>    </p>\n</li></ul>    </div>\n    <div class=\"section section-2 \" id=\"src-46257788_TitaniumSDK5.5.1.GAReleaseNote-AboutThisRelease\">\n        <h2 class=\"heading \"><span>About This Release</span></h2>\n    <p>Titanium SDK 5.5.1.GA is a patch release of the SDK, addressing high-priority issues from previous releases.    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-46257788_TitaniumSDK5.5.1.GAReleaseNote-CommunityCredits\">\n        <h2 class=\"heading \"><span>Community Credits</span></h2>\n<ul class=\" \"><li class=\" \">    <p>Vittorio Sorbera for correcting some code samples in <a class=\"document-link \" href=\"#!/guide/Titanium_SDK_5.5.0.GA_Release_Note\">Titanium SDK 5.5.0.GA Release Note</a>    </p>\n</li></ul>    </div>\n    <div class=\"section section-2 \" id=\"src-46257788_TitaniumSDK5.5.1.GAReleaseNote-FixedIssuespatchreleases\">\n        <h2 class=\"heading \"><span>Fixed Issues patch releases</span></h2>\n<ul class=\" \"><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/MOD-2298\" target=\"_blank\">MOD-2298</a> - Ti.Facebook: Unformatted iOS 10 / 5.5.0 example causes publish-process to break    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-23904\" target=\"_blank\">TIMOB-23904</a> - iOS10: Button listener takes two taps before responding for Facebook login    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-23908\" target=\"_blank\">TIMOB-23908</a> - Xcode 8: Builds with SDK 5.5.0 are missing APS-entitlements for push-notifications    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-23924\" target=\"_blank\">TIMOB-23924</a> - iOS app rejection due to usage of non-public API    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-23929\" target=\"_blank\">TIMOB-23929</a> - Rename contextId to stop confusing Apple&apos;s private API scan    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-23941\" target=\"_blank\">TIMOB-23941</a> - CLI: ti setup sdk doesn&apos;t work when setting &quot;latest&quot;    </p>\n</li></ul>    <p>    <span id=\"src-46257788_apichanges\"><a name=\"src-46257788_apichanges\"/></span>\n    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-46257788_TitaniumSDK5.5.1.GAReleaseNote-APIChanges\">\n        <h2 class=\"heading \"><span>API Changes</span></h2>\n    <p>There was no API changes in this release.    </p>\n    </div>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=46257788\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"Titanium SDK 5.5.1.GA Release Note"});